        public void ToString(
            INpcGetter item,
            FileGeneration fg,
            string? name = null,
            Npc.Mask<bool>? printMask = null)
        {
            if (name == null)
            {
                fg.AppendLine($"Npc =>");
            }
            else
            {
                fg.AppendLine($"{name} (Npc) =>");
            }
            fg.AppendLine("[");
            using (new DepthWrapper(fg))
            {
                ToStringFields(
                    item: item,
                    fg: fg,
                    printMask: printMask);
            }
            fg.AppendLine("]");
        }
        
